import { IComponentList } from '../../Canvas';

import { Record, OrderedSet } from 'immutable';

// tslint:disable:max-line-length
const data = 'data:image/jpeg;base64,';

export interface IImageState {
    src: string;
    width: number;
    height: number;
    imageMagnifierList: OrderedSet<IComponentList>;
    maxMagnifierId: number;

    backgroundColor: string;
    borderColor: string;
    borderWidth: number;
}

const defaultRecord: IImageState = {
    src: data,
    width: 621,
    height: 509,
    imageMagnifierList: OrderedSet(),
    maxMagnifierId: 0,

    backgroundColor: '#FFF',
    borderColor: '#FFF',
    borderWidth: 0
};

export const ImageRecord: Record.Class = Record(defaultRecord);

export class ImageState extends ImageRecord {
    static create(imageState: IImageState): ImageState {
        return new ImageState(imageState);
    }

    static set(imageState: ImageState, put: any): ImageState {
        const map: any = imageState.withMutations(
            (state: any) => {
                state.merge(put);
            }
        );

        return new ImageState(map);
    }

    getSrc(): string {
        return this.get('src');
    }

    getWidth(): number {
        return this.get('width');
    }

    getHeight(): number {
        return this.get('height');
    }

    getImageMagnifierList(): OrderedSet<IComponentList> {
        return this.get('imageMagnifierList');
    }

    getMaxMagnifierId(): number {
        return this.get('maxMagnifierId');
    }

    getBackgroundColor(): string {
        return this.get('backgroundColor');
    }

    getBorderColor(): string {
        return this.get('borderColor');
    }

    getBorderWidth(): number {
        return this.get('borderWidth');
    }
}
